import React from "react";
import Carousel from "./Carousel";
import HomeProduct from "./HomeProduct";
import { useState, useEffect } from "react";
import axios from "axios";
import "./Home.css";

const Home = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get("/api/products/featured");
      setProducts(result.data);
    };
    fetchData();
  }, []);

  return (
    <div className="home">
      <Carousel />
      <div className="home__row">
        {products.map(({ _id, ...props }) => {
          <HomeProduct id={_id} {...props} />;
        })}

        <HomeProduct
          id="235136"
          title="Fender Player Telecaster Maple Fingerboard Electric Guitar Black"
          img="https://media.guitarcenter.com/is/image/MMGS7/L21568000002000-00-720x720.jpg"
          price={849.99}
          rating={4.5}
        />
        <HomeProduct
          id="23532636"
          title="Gibson Les Paul Standard '60s Faded Electric Guitar Vintage Cherry Sunburst"
          img="https://media.guitarcenter.com/is/image/MMGS7/L96507000001000-00-720x720.jpg"
          price={2499.99}
          rating={4}
        />
        <HomeProduct
          id="245324"
          title="Squier Bullet Telecaster Limited-Edition Electric Guitar Surf Green"
          img="https://media.guitarcenter.com/is/image/MMGS7/L20490000001000-00-720x720.jpg"
          price={2499.99}
          rating={4}
        />
      </div>
      <div className="home__row"></div>
      <div className="home__row"></div>
    </div>
  );
};

export default Home;
